export const GetTypecaseICon = (iconName) => {
  return iconName === "accident" ? (
    <AccidentIcon />
  ) : iconName === "carburglary" ? (
    <AccidentIcon />
  ) : iconName === "theftcar" ? (
    <AccidentIcon />
  ) : iconName === "nature" ? (
    <AccidentIcon />
  ) : iconName === "water" ? (
    <WaterDamageIcon />
  ) : iconName === "fire" ? (
    <FireDamageIcon />
  ) : iconName === "burglary" ? (
    <AccidentIcon />
  ) : iconName === "person-3d" ? (
    <AccidentIcon />
  ) : iconName === "other" ? (
    <AccidentIcon />
  ) : (
    <AccidentIcon />
  );
};

